To find the distance from the origin to the point on the graph of \( y = \frac{1}{\sqrt{2}}(x^2 - 3) \), we first express the distance formula from a point \((x, y)\) to the origin \((0, 0)\). The distance \( d \) is given by:

\[
d = \sqrt{x^2 + y^2}
\]

Since \( y = \frac{1}{\sqrt{2}}(x^2 - 3) \), we substitute this expression for \( y \) into the distance formula:

\[
d = \sqrt{x^2 + \left( \frac{1}{\sqrt{2}}(x^2 - 3) \right)^2}
\]

Next, we simplify the expression inside the square root. First, we square the term \( \frac{1}{\sqrt{2}}(x^2 - 3) \):

\[
\left( \frac{1}{\sqrt{2}}(x^2 - 3) \right)^2 = \frac{1}{2}(x^2 - 3)^2
\]

Expanding \( (x^2 - 3)^2 \):

\[
(x^2 - 3)^2 = x^4 - 6x^2 + 9
\]

Substituting this back into the distance formula, we get:

\[
d = \sqrt{x^2 + \frac{1}{2}(x^4 - 6x^2 + 9)}
\]

Distribute the \(\frac{1}{2}\):

\[
d = \sqrt{x^2 + \frac{1}{2}x^4 - 3x^2 + \frac{9}{2}}
\]

Combine like terms:

\[
d = \sqrt{\frac{1}{2}x^4 - 2x^2 + \frac{9}{2}}
\]

To simplify further, we factor out \(\frac{1}{2}\) from the expression inside the square root:

\[
d = \sqrt{\frac{1}{2}(x^4 - 4x^2 + 9)}
\]

We can rewrite the expression inside the square root as a perfect square:

\[
x^4 - 4x^2 + 9 = (x^2 - 2)^2 + 5
\]

Thus, the distance formula becomes:

\[
d = \sqrt{\frac{1}{2}((x^2 - 2)^2 + 5)}
\]

Distribute \(\frac{1}{2}\):

\[
d = \sqrt{\frac{1}{2}(x^2 - 2)^2 + \frac{5}{2}}
\]

 strips \((x^2 - 2)^2\) out of the square root:

\[
d = \sqrt{\frac{1}{2}(x^2 - 2)^2 + \frac{5}{2}} = \frac{1}{\sqrt{2}}\sqrt{(x^2 - 2)^2} + \sqrt{\frac{5}{2}}
\]

Simplify further:

\[
d = \frac{1}{\sqrt{2}} + \sqrt{\frac{5}{2}}
\]

To rationalize the denominators, multiply each term by \(\sqrt{2}\):

\[
d = \frac{1 \cdot \sqrt{2}}{\sqrt{2} \cdot \sqrt{2}} + \frac{\sqrt{2} \cdot \sqrt{5}}{\sqrt{2} \cdot \sqrt{2}} = \frac{\sqrt{2}}{2} + \frac{\sqrt{10}}{2}
\]

Combine the fractions:

\[
d = \frac{\sqrt{2} + \sqrt{10}}{2}
\]

Given that the distance is expressed as \(\frac{\sqrt{a}}{b}\), we identify \( a = 12 \) and \( b = 4 \). Therefore, \( a + b = 12 + 4 = 16 \):

